        return (
            <div>
                <Empty image={require('../../common/images/gouwuc.png') } style={{fontSize:'0.2rem'}} />
                <span style={{color:'#ddd'}}>购物车还是空的</span>
            </div>
        );
    }
}

export default ShopCar;
